import React from 'react';

// import ProgressBar from './ProgressBar';
import Button from './button';

const UserList=(props)=>{
    return(
        <div>
            <h2>Users List</h2>
            <table className="table table-bordered">
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Birth Date</th>
                        <th>Languages</th>
                        <th>Gender</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>Xyz</td>
                        <td>Xyz</td>
                        <td>Xyz</td>
                        <td>Xyz</td>
                    </tr>
                </tbody>
            </table>
            <Button/>
        </div>
    )
}

export default UserList;
